import logo from './logo.svg';
import './App.css';
import login from './Components/login_page.js';

class App extends Component {

  render() {
    return (
        <div className="login">
            <div>
                <p>Username:</p>
                <input type="text" placeholder="Username"/>
                <p>Password</p>
                <input type="text" placeholder="Password"/>
                <input type="submit" value="Submit"/>
            </div>
            <login />
        </div>
